DROP TABLE IF EXISTS billionaires;

CREATE TABLE billionaires (
                              id INT AUTO_INCREMENT  PRIMARY KEY,
                              first_name VARCHAR(250) NOT NULL,
                              last_name VARCHAR(250) NOT NULL,
                              career VARCHAR(250) DEFAULT NULL
);

create table customers
(
    customer_number           int auto_increment primary key,
    created_by                varchar(255)   null,
    created_date              datetime       null,
    last_modified_by          varchar(255)   null,
    last_modified_date        datetime       null,
    version                   int            null,
    address_line1             varchar(50)    not null,
    address_line2             varchar(50)    null,
    city                      varchar(50)    not null,
    country                   varchar(50)    not null,
    postal_code               varchar(15)    not null,
    state                     varchar(50)    not null,
    contact_first_name        varchar(50)    not null,
    contact_last_name         varchar(50)    not null,
    credit_limit              decimal(19, 2) null,
    customer_name             varchar(50)    not null,
    phone                     varchar(50)    not null,
    sales_rep_employee_number int            null
);

create table employees
(
    employee_number    int auto_increment primary key,
    created_by         varchar(255) null,
    created_date       datetime     null,
    last_modified_by   varchar(255) null,
    last_modified_date datetime     null,
    version            int          null,
    email              varchar(100) not null,
    extension          varchar(10)  not null,
    first_name         varchar(50)  not null,
    job_title          varchar(50)  not null,
    last_name          varchar(50)  not null,
    office_code        varchar(10)  not null,
    reports_to         int          null
);

create table offices
(
    office_code        varchar(10)  not null primary key,
    created_by         varchar(255) null,
    created_date       datetime     null,
    last_modified_by   varchar(255) null,
    last_modified_date datetime     null,
    version            int          null,
    address_line1      varchar(50)  not null,
    address_line2      varchar(50)  null,
    city               varchar(50)  not null,
    country            varchar(50)  not null,
    postal_code        varchar(15)  not null,
    state              varchar(50)  not null,
    phone              varchar(50)  not null,
    territory          varchar(10)  not null
);

create table order_details
(
    order_number       int            not null,
    product_code       varchar(15)    not null,
    created_by         varchar(255)   null,
    created_date       datetime       null,
    last_modified_by   varchar(255)   null,
    last_modified_date datetime       null,
    version            int            null,
    order_line_number  int            not null,
    price_each         decimal(19, 2) not null,
    quantity_ordered   int            not null,
    primary key (order_number, product_code)
);


create table orders
(
    order_number       int auto_increment primary key,
    created_by         varchar(255) null,
    created_date       datetime     null,
    last_modified_by   varchar(255) null,
    last_modified_date datetime     null,
    version            int          null,
    comments           varchar(255) null,
    customer_number    int          not null,
    order_date         date         not null,
    required_date      date         not null,
    shipped_date       date         null,
    status             varchar(15)  not null
);

create index FKms2886gi989auk8wkyl7vwcms
    on orders (customer_number);

create table payments
(
    check_number       varchar(50)    not null,
    customer_number    int            not null,
    created_by         varchar(255)   null,
    created_date       datetime       null,
    last_modified_by   varchar(255)   null,
    last_modified_date datetime       null,
    version            int            null,
    amount             decimal(19, 2) not null,
    payment_date       date           not null,
    primary key (check_number, customer_number)
);

create index FKhbo7ns1yntc33h1qvltl1hi3j
    on payments (customer_number);


create table product_lines
(
    product_line       varchar(50)  not null primary key,
    created_by         varchar(255) null,
    created_date       datetime     null,
    last_modified_by   varchar(255) null,
    last_modified_date datetime     null,
    version            int          null,
    html_description   varchar(255) null,
    image              tinyblob     null,
    text_description   varchar(255) null
);

create table products
(
    product_code        varchar(15)    not null primary key,
    created_by          varchar(255)   null,
    created_date        datetime       null,
    last_modified_by    varchar(255)   null,
    last_modified_date  datetime       null,
    version             int            null,
    buy_price           decimal(19, 2) not null,
    msrp                decimal(19, 2) not null,
    product_description varchar(255)   not null,
    product_name        varchar(70)    not null,
    product_scale       varchar(10)    not null,
    product_vendor      varchar(50)    not null,
    quantity_in_stock   int            not null,
    product_line        varchar(50)    not null
);

create index FKqwfeowalm0224xwsxaytydmh
    on products (product_line);










